<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Advent of Code - Day 9 Visualization</title>
  <style>
    * { margin: 0; padding: 0; } /* Only to remove default browser margin */

    .l {
      padding-top: 100%;
      animation-duration: 1s;
      animation-iteration-count: infinite;
      animation-timing-function: ease-in-out;
    } /* So the div's height = the div's width */

    @keyframes glow_0 {
      0%   { background-color: hsl(20, 90%, 15%); }
      50%  { background-color: hsl(20, 90%, 20%); }
      100% { background-color: hsl(20, 90%, 15%); }
    }

    @keyframes glow_1 {
      0%   { background-color: hsl(20, 90%, 20%); }
      50%  { background-color: hsl(20, 90%, 25%); }
      100% { background-color: hsl(20, 90%, 20%); }
    }

    @keyframes glow_2 {
      0%   { background-color: hsl(20, 90%, 25%); }
      50%  { background-color: hsl(20, 90%, 30%); }
      100% { background-color: hsl(20, 90%, 25%); }
    }

    @keyframes glow_3 {
      0%   { background-color: hsl(20, 90%, 30%); }
      50%  { background-color: hsl(20, 90%, 35%); }
      100% { background-color: hsl(20, 90%, 30%); }
    }

    @keyframes glow_4 {
      0%   { background-color: hsl(20, 90%, 35%); }
      50%  { background-color: hsl(20, 90%, 40%); }
      100% { background-color: hsl(20, 90%, 35%); }
    }

    @keyframes glow_5 {
      0%   { background-color: hsl(20, 90%, 40%); }
      50%  { background-color: hsl(20, 90%, 45%); }
      100% { background-color: hsl(20, 90%, 40%); }
    }

    @keyframes glow_6 {
      0%   { background-color: hsl(20, 90%, 45%); }
      50%  { background-color: hsl(20, 90%, 50%); }
      100% { background-color: hsl(20, 90%, 45%); }
    }

    @keyframes glow_7 {
      0%   { background-color: hsl(20, 90%, 50%); }
      50%  { background-color: hsl(20, 90%, 55%); }
      100% { background-color: hsl(20, 90%, 50%); }
    }

    @keyframes glow_8 {
      0%   { background-color: hsl(20, 90%, 65%); }
      50%  { background-color: hsl(20, 90%, 70%); }
      100% { background-color: hsl(20, 90%, 65%); }
    }

    .l_0 { background-color: hsl(20, 90%, 15%); animation-name: glow_0; }
    .l_1 { background-color: hsl(20, 90%, 20%); animation-name: glow_1; animation-delay: .1s; }
    .l_2 { background-color: hsl(20, 90%, 25%); animation-name: glow_2; animation-delay: .2s; }
    .l_3 { background-color: hsl(20, 90%, 30%); animation-name: glow_3; animation-delay: .4s; }
    .l_4 { background-color: hsl(20, 90%, 35%); animation-name: glow_4; animation-delay: .5s; }
    .l_5 { background-color: hsl(20, 90%, 40%); animation-name: glow_5; animation-delay: .6s; }
    .l_6 { background-color: hsl(20, 90%, 45%); animation-name: glow_6; animation-delay: .7s; }
    .l_7 { background-color: hsl(20, 90%, 50%); animation-name: glow_7; animation-delay: .9s; }
    .l_8 { background-color: hsl(20, 90%, 65%); animation-name: glow_8; animation-delay: 1s; }
    .l_9 { background-color: hsl(20, 90%, 90%); }

    .wrapper {
      width: 100%;
      display: grid;

      /* 
       * 100x100 grid where every div will have a width of 1%.
       * And because we have a 100x100 grid, the visualization
       * will always be as wide as the screen.
       */
      grid-template-columns: repeat(100, 1%); 
    }
  </style>
</head>
